import React from "react";
import styled from "styled-components";
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
const StyledDiv = styled.div`
  display: flex;
  width: 100%;
  flex-wrap: wrap;
  justify-content: space-around;
  img {
    width: 200px;
    height: 100px;
    margin-top: 5px;
  }
`;
////////////////////////////////////////////////////////////////
const ProductDiv = styled.div`
  display: flex;
  flex-direction: column;
  width: 300px;
  height: 300px;
  border: 0.1px solid black;
  jus
  img {
    left: 0;
    right: 0;
    margin: auto;
  }
`;
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
function Products() {
  return (
    <StyledDiv>
      <ProductDiv>
        <img
          src={
            "https://images-eu.ssl-images-amazon.com/images/I/61Sxu3XttGL.__AC_SY300_SX300_QL70_ML2_.jpg"
          }
          alt=""
        />
      </ProductDiv>
      <ProductDiv>
        <img src="" alt="" />
      </ProductDiv>
      <ProductDiv>
        <img src="" alt="" />
      </ProductDiv>
      <ProductDiv>
        <img src="" alt="" />
      </ProductDiv>
    </StyledDiv>
  );
}

export default Products;
